//     method:"DELETE",
//   })
//   .then(()=>{
//     setHotels(hotels.filter((hotel)=> hotel.id !== id))
//   })
// }



  return (
    <div className="App">
      <header style={{textAlign:"center", backgroundColor:"lightgreen", fontSize:"35px"}}>Jambo-Journeys App</header>
      <Navbar />
    <Switch>
    <Route path="/parks">
    <ParkList parks = {parks}/>
    </Route>
    <Route path="/hotels">
    <HotelList hotels={hotels}/>
    </Route>
    <Route path="/about">
    <About/>
    </Route>
    <Route path="/addparks">
    <AddPark />
    </Route>
    <Route path="/addhotels">
    <AddHotel/>
    </Route>
    <Route path="/contacts">
    <Contacts/>
    </Route>
    <Route path="/updhotel">
    <UpdateHotels/>
    </Route>
    <Route path="/updpark">
    <UpdateParks/>
    </Route>
    <Route path="/bookings">
    <Boo/>
    </Route>
    <Route exact path="/">
    <Login />
    </Route>
    </Switch>

    </div>
  );
}

export default App;
